function mostrarTabela(){
    const actualTable = document.querySelector('table');
    if (actualTable) {
        actualTable.remove();
    }

    const tabela = document.createElement('table');
    tabela.id = 'myTable';
    const linha = document.createElement('tr');
    const colunaIcon = document.createElement('th');
    const colunaNome = document.createElement('th');
    const colunaBotao = document.createElement('th');
    
    tabela.appendChild(linha);

    colunaIcon.innerText = 'pokemon';
    colunaNome.innerText = 'nome';
    colunaIcon.className = "icone";

    linha.appendChild(colunaIcon);
    linha.appendChild(colunaNome);
    linha.appendChild(colunaBotao);

    listPoke.forEach(function (element){
        const linhaTabela = criarTabela(
            element.url_icon,
            element.name,
            element.id
        )
            tabela.appendChild(linhaTabela);
            tabela.className = 'tabela';
    })
    document.body.appendChild(tabela);
}

function criarTabela(url_icon, name, id) {
    const botao = document.createElement('button');
    botao.innerHTML = "clique";

    const linha = document.createElement('tr');
    const colunaIcon = document.createElement('img');
    const colunaNome = document.createElement('td');
    const colunaBotao = document.createElement('td');

    colunaIcon.className = 'colunaIcon';
    colunaNome.className = 'colunaNome';

    botao.onclick = function(){(otherpage(id))};

    colunaIcon.src = url_icon;
    url_icon = function () {
        colunaIcon.src = pokemon.url_icon_2;
    }
    colunaNome.innerText = name;
    colunaBotao.appendChild(botao);

    linha.appendChild(colunaIcon);
    linha.appendChild(colunaNome);
    linha.appendChild(colunaBotao);
    return linha;
}


mostrarTabela();

function otherpage(id){
    window.location.href = "pokemon.html?" + id;
}

function myFunction() {
    var input, filter, table, tr, td, i, txtValue;
    input = document.getElementById('myInput');
    filter = input.value.toUpperCase();
    table = document.getElementById('myTable');
    tr = table.getElementsByTagName("tr");
  
    for (i = 0; i < tr.length; i++) {
      td = tr[i].getElementsByTagName("td")[0];
      if (td) {
        txtValue = td.textContent || td.innerText;
        if (txtValue.toUpperCase().indexOf(filter) > -1) {
          tr[i].style.display = "";
        } else {
          tr[i].style.display = "none";
        }
      }
    }
  }